INSERT INTO `encuesta` VALUES ('1', 'FO-DO/AA-002', 'ENCUESTA INSTITUCIONAL A ESTUDIANTES DE PREGRADO', 'Estimados miembros de la comunidad UTB:\r\n\r\nEsperamos que se encuentren muy bien al igual que sus familias.\r\n\r\nCon gran entusiasmo les comunicamos que la Universidad inicia su autoevaluación con miras a la renovación, por tercera vez consecutiva, de la acreditación institucional. Este proceso es de vital importancia porque nos permite fortalecer el espíritu de mejora continua que caracteriza a la UTB.\r\n', 'El objetivo de la misma es indagar sobre la opinión y/o conocimiento de la comunidad académica de los siguientes aspectos: Identidad institucional, procesos académicos, de investigación, de extensión, visibilidad nacional e internacional, bienestar institucional, procesos de mejoramiento continuo, gobierno, gestión y sostenibilidad, además aspectos relacionados con estudiantes, profesores y egresados.\r\n\r\nPara ello, a partir de hoy estará habilitada esta encuesta, la cual tiene una duración promedio de 30 minutos. Los resultados obtenidos serán empleados para la consolidación del informe de autoevaluación y del Plan de Mejoramiento Institucional. \r\n\r\nContamos con tu activa participación en el proceso. \r\n', '1', 'Procedimiento: Autoevaluación', 'Rige a partir de: 04/04/08', '1');
